import { Fragment } from "react";
import classes from "./DropDown.module.scss";

const DropDown = () => {
  return (
    <Fragment>
      <select className={classes["select-box"]}>
        <option>Product</option>
      </select>
    </Fragment>
  );
};

export default DropDown;
